                <CartesianGrid strokeDasharray="2 2" />
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Line type="monotone" dataKey="Semaine_PrÃ©cedente" stroke="#FFFFFF" activeDot={{ r: 8 }} />
                <Line type="monotone" dataKey="Semaine_Actuelle" stroke="#707070" />
            </LineChart>
</div>
      );
    }



}
export default Widget_Courbes;
